import React from "react";
import NavBar from "./NavBar";

function ProfilePage() {
    return (
        <div>
            <NavBar></NavBar><br></br>
            <center>
                <h1>Hello</h1>
                <u><h3>Your Errors</h3></u>
            </center>
        </div>
    )
}

export default ProfilePage;
